import React from 'react';
import Tabs from "../tab-forms/tab";
import styled from "styled-components";

const ContainerWrapper = styled("div")`
position:absolute;
top:0px;
`;

const Container = () => {
    return (
        <ContainerWrapper>
            <Tabs />
        </ContainerWrapper>
    );
}

export default Container;
